// RegisterTab.js
import * as React from 'react';

const RegisterTab = ({ onChange, onSubmit }) => {
  return (
    <div className="tab-pane fade" id="pills-register">
      <form onSubmit={onSubmit}>
        <div className="form-outline mb-4">
          <input type="text" id="firstName" name="firstName" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="firstName">First name</label>
        </div>
        <div className="form-outline mb-4">
          <input type="text" id="lastName" name="lastName" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="lastName">Last name</label>
        </div>
        <div className="form-outline mb-4">
          <input type="text" id="login" name="login" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="login">Username</label>
        </div>
        <div className="form-outline mb-4">
          <input type="password" id="registerPassword" name="password" className="form-control" onChange={onChange} />
          <label className="form-label" htmlFor="registerPassword">Password</label>
        </div>
        <button type="submit" className="btn btn-primary btn-block mb-3">Sign up</button>
      </form>
    </div>
  );
};

export default RegisterTab;
